import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { 
  Container, 
  Card, 
  Badge, 
  Accordion, 
  Table, 
  Button,
  Row,
  Col,
  Form,
  InputGroup
} from 'react-bootstrap';

const RequestList = ({ data }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filterStatus, setFilterStatus] = useState('all');
  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 20;

  // Filter requests
  const filteredRequests = data.requests.filter(req => {
    const matchesSearch = 
      req.request.url.toLowerCase().includes(searchTerm.toLowerCase()) ||
      req.request.method.toLowerCase().includes(searchTerm.toLowerCase()) ||
      req.id.toLowerCase().includes(searchTerm.toLowerCase());

    const matchesStatus = 
      filterStatus === 'all' ||
      (filterStatus === 'matched' && req.wasMatched) ||
      (filterStatus === 'unmatched' && !req.wasMatched);

    return matchesSearch && matchesStatus;
  });

  // Pagination
  const totalPages = Math.ceil(filteredRequests.length / itemsPerPage);
  const startIndex = (currentPage - 1) * itemsPerPage;
  const paginatedRequests = filteredRequests.slice(startIndex, startIndex + itemsPerPage);

  // Format date
  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  // Get method badge color
  const getMethodColor = (method) => {
    const colors = {
      'GET': 'primary',
      'POST': 'success',
      'PUT': 'warning',
      'DELETE': 'danger',
      'PATCH': 'info'
    };
    return colors[method] || 'secondary';
  };

  // Get status badge color
  const getStatusColor = (status) => {
    if (status >= 200 && status < 300) return 'success';
    if (status >= 300 && status < 400) return 'info';
    if (status >= 400 && status < 500) return 'warning';
    if (status >= 500) return 'danger';
    return 'secondary';
  };

  return (
    <Container fluid className="py-4">
      <Row className="mb-4">
        <Col>
          <h1 className="mb-4">
            <i className="bi bi-list-check"></i> Request Monitor
            <Badge bg="secondary" className="ms-3">{filteredRequests.length} requests</Badge>
          </h1>
        </Col>
      </Row>

      {/* Filter and Search Bar */}
      <Row className="mb-4">
        <Col md={8}>
          <InputGroup>
            <InputGroup.Text>
              <i className="bi bi-search"></i>
            </InputGroup.Text>
            <Form.Control
              type="text"
              placeholder="Search by URL, method, or ID..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </InputGroup>
        </Col>
        <Col md={4}>
          <Form.Select 
            value={filterStatus} 
            onChange={(e) => setFilterStatus(e.target.value)}
          >
            <option value="all">All Requests</option>
            <option value="matched">Matched Only</option>
            <option value="unmatched">Unmatched Only</option>
          </Form.Select>
        </Col>
      </Row>

      {/* Request Cards */}
      <Accordion defaultActiveKey="0">
        {paginatedRequests.map((req, index) => (
          <Card key={req.id} className="mb-3 shadow-sm">
            <Accordion.Header as="div">
              <Row className="w-100 align-items-center">
                <Col md={1}>
                  <Badge bg={getMethodColor(req.request.method)} className="me-2">
                    {req.request.method}
                  </Badge>
                </Col>
                <Col md={5}>
                  <code className="text-break">{req.request.url}</code>
                </Col>
                <Col md={2}>
                  <Badge bg={getStatusColor(req.response.status)}>
                    {req.response.status}
                  </Badge>
                </Col>
                <Col md={2}>
                  {req.wasMatched ? (
                    <Badge bg="success">
                      <i className="bi bi-check-circle"></i> Matched
                    </Badge>
                  ) : (
                    <Badge bg="danger">
                      <i className="bi bi-x-circle"></i> Not Matched
                    </Badge>
                  )}
                </Col>
                <Col md={2}>
                  <small className="text-muted">
                    {formatDate(req.request.loggedDateString)}
                  </small>
                </Col>
              </Row>
            </Accordion.Header>

            <Accordion.Body>
              <Accordion.Item eventKey={`${index}`}>
                {/* Request Details */}
                <Card className="mb-3">
                  <Card.Header className="bg-light">
                    <strong>Request Details</strong>
                  </Card.Header>
                  <Card.Body>
                    <Row>
                      <Col md={6}>
                        <p><strong>ID:</strong> <code>{req.id}</code></p>
                        <p><strong>Client IP:</strong> {req.request.clientIp}</p>
                        <p><strong>Protocol:</strong> {req.request.protocol}</p>
                        <p><strong>Host:</strong> {req.request.host}:{req.request.port}</p>
                      </Col>
                      <Col md={6}>
                        <p><strong>Absolute URL:</strong></p>
                        <code className="d-block text-break bg-light p-2 rounded">
                          {req.request.absoluteUrl}
                        </code>
                      </Col>
                    </Row>

                    {/* Request Headers */}
                    <Accordion className="mt-3">
                      <Accordion.Item eventKey="headers">
                        <Accordion.Header>
                          <strong>Headers</strong> 
                          <Badge bg="info" className="ms-2">
                            {Object.keys(req.request.headers).length}
                          </Badge>
                        </Accordion.Header>
                        <Accordion.Body>
                          <Table striped bordered hover size="sm">
                            <thead>
                              <tr>
                                <th>Header</th>
                                <th>Value</th>
                              </tr>
                            </thead>
                            <tbody>
                              {Object.entries(req.request.headers).map(([key, value]) => (
                                <tr key={key}>
                                  <td><strong>{key}</strong></td>
                                  <td className="text-break">
                                    <code>{value}</code>
                                  </td>
                                </tr>
                              ))}
                            </tbody>
                          </Table>
                        </Accordion.Body>
                      </Accordion.Item>
                    </Accordion>

                    {/* Request Body */}
                    {req.request.body && (
                      <Accordion className="mt-2">
                        <Accordion.Item eventKey="request-body">
                          <Accordion.Header>
                            <strong>Request Body</strong>
                          </Accordion.Header>
                          <Accordion.Body>
                            <pre className="bg-light p-3 rounded" style={{ maxHeight: '300px', overflow: 'auto' }}>
                              <code>{req.request.body}</code>
                            </pre>
                          </Accordion.Body>
                        </Accordion.Item>
                      </Accordion>
                    )}
                  </Card.Body>
                </Card>

                {/* Response Details */}
                <Card className="mb-3">
                  <Card.Header className="bg-light">
                    <strong>Response Details</strong>
                  </Card.Header>
                  <Card.Body>
                    <Row>
                      <Col md={6}>
                        <p>
                          <strong>Status:</strong>{' '}
                          <Badge bg={getStatusColor(req.response.status)}>
                            {req.response.status}
                          </Badge>
                        </p>
                      </Col>
                      <Col md={6}>
                        <p><strong>From Configured Stub:</strong>{' '}
                          {req.responseDefinition.fromConfiguredStub ? '✓ Yes' : '✗ No'}
                        </p>
                      </Col>
                    </Row>

                    {/* Response Headers */}
                    {req.response.headers && Object.keys(req.response.headers).length > 0 && (
                      <Accordion className="mt-3">
                        <Accordion.Item eventKey="response-headers">
                          <Accordion.Header>
                            <strong>Response Headers</strong>
                          </Accordion.Header>
                          <Accordion.Body>
                            <Table striped bordered hover size="sm">
                              <tbody>
                                {Object.entries(req.response.headers).map(([key, value]) => (
                                  <tr key={key}>
                                    <td><strong>{key}</strong></td>
                                    <td><code>{value}</code></td>
                                  </tr>
                                ))}
                              </tbody>
                            </Table>
                          </Accordion.Body>
                        </Accordion.Item>
                      </Accordion>
                    )}

                    {/* Response Body */}
                    {req.response.body && (
                      <Accordion className="mt-2">
                        <Accordion.Item eventKey="response-body">
                          <Accordion.Header>
                            <strong>Response Body</strong>
                          </Accordion.Header>
                          <Accordion.Body>
                            <pre className="bg-light p-3 rounded" style={{ maxHeight: '300px', overflow: 'auto' }}>
                              <code>{req.response.body}</code>
                            </pre>
                          </Accordion.Body>
                        </Accordion.Item>
                      </Accordion>
                    )}
                  </Card.Body>
                </Card>

                {/* Timing Information */}
                <Card className="mb-3">
                  <Card.Header className="bg-light">
                    <strong>Timing Information</strong>
                  </Card.Header>
                  <Card.Body>
                    <Row>
                      <Col md={3}>
                        <p><strong>Process Time:</strong> {req.timing.processTime}ms</p>
                      </Col>
                      <Col md={3}>
                        <p><strong>Serve Time:</strong> {req.timing.serveTime}ms</p>
                      </Col>
                      <Col md={3}>
                        <p><strong>Response Send:</strong> {req.timing.responseSendTime}ms</p>
                      </Col>
                      <Col md={3}>
                        <p><strong>Total Time:</strong> {req.timing.totalTime}ms</p>
                      </Col>
                    </Row>
                  </Card.Body>
                </Card>

                {/* Stub Mapping */}
                {req.stubMapping && (
                  <Card>
                    <Card.Header className="bg-light">
                      <strong>Stub Mapping</strong>
                    </Card.Header>
                    <Card.Body>
                      <p><strong>Stub ID:</strong> <code>{req.stubMapping.id}</code></p>
                      {req.stubMapping.metadata?.name && (
                        <p><strong>Name:</strong> {req.stubMapping.metadata.name}</p>
                      )}
                      <p><strong>Persistent:</strong> {req.stubMapping.persistent ? '✓ Yes' : '✗ No'}</p>
                    </Card.Body>
                  </Card>
                )}
              </Accordion.Item>
            </Accordion.Body>
          </Card>
        ))}
      </Accordion>

      {/* Pagination */}
      {totalPages > 1 && (
        <Row className="mt-4">
          <Col className="d-flex justify-content-center">
            <nav>
              <ul className="pagination">
                <li className={`page-item ${currentPage === 1 ? 'disabled' : ''}`}>
                  <Button 
                    variant="outline-primary" 
                    onClick={() => setCurrentPage(prev => Math.max(1, prev - 1))}
                    disabled={currentPage === 1}
                  >
                    Previous
                  </Button>
                </li>
                {[...Array(totalPages)].map((_, i) => (
                  <li key={i} className={`page-item ${currentPage === i + 1 ? 'active' : ''}`}>
                    <Button
                      variant={currentPage === i + 1 ? 'primary' : 'outline-primary'}
                      onClick={() => setCurrentPage(i + 1)}
                      className="mx-1"
                    >
                      {i + 1}
                    </Button>
                  </li>
                ))}
                <li className={`page-item ${currentPage === totalPages ? 'disabled' : ''}`}>
                  <Button
                    variant="outline-primary"
                    onClick={() => setCurrentPage(prev => Math.min(totalPages, prev + 1))}
                    disabled={currentPage === totalPages}
                  >
                    Next
                  </Button>
                </li>
              </ul>
            </nav>
          </Col>
        </Row>
      )}
    </Container>
  );
};

export default RequestList;
